import Applayout from './../components/Applayout';
import Head from "next/head";
const Profile = () =>{
    return(
        <>
        <Head>
                <meta charSet='utf-8'></meta>
                <title>NodeBird</title>
            </Head>
        <Applayout>내 프로필</Applayout>
        </>
    );
}

export default Profile;
